div.div:
Объявление функции - сигнатура функции, записанная как отдельное выражение.
type name(args...);
Объявление является указанием компилятору и линковщику на то, что где-то существует определение функции (об этом дальше), что позволяет использовать вызов функции в сложных многофайловых проектах.
Объявлений может быть от 1 до бесконечности.
Ex. void foo();
void foo();
void foo();
void foo();
void foo(); // допустимо
